import React from 'react'

const MobileHeader = () => {
  return (
    <header className="mobileHeader">
        <h1 id="mobileTitle"> Sawasdee <br/>Thai Cuisine </h1>
        <embed src="https://www.sawasdeesoquel.com/menus/LunchEmbeded.pdf"  width="100%"/>
    </header>

  )
}

export default MobileHeader
